import temas from '../data';

const ListadoTemas = () => (
  <div>
    <h2>Listado de Temas</h2>
    <ul>
      {temas.map((tema) => (
        <li key={tema.id}>
          <h3>{tema.titulo}</h3>
          <p>{tema.descripcion}</p>
        </li>
      ))}
    </ul>
  </div>
);

export default ListadoTemas;
